import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./home/Home";
import About from "./about/About";
function App() {
  return (
    <Router>
      <div className="App">
        <Route exact={true} path="/">
          <Home />
        </Route>
        <Route exact={true} path="/about">
          <About />
        </Route>
      </div>
    </Router>
  );
}

export default App;
